      <Typography
        sx={{
          fontWeight: 'bold',
          display: 'flex',
          flexWrap: 'wrap',
          justifyContent: 'center',
          alignItems: 'center',
          fontWeight: 'bold',
          fontSize: '30px',
          marginTop: '20px',
          color: '#7D4896',
          marginBottom: '20px',
        }}
